import { BrowserRouter as Router, Switch, Route } from 'react-router';
import Home from './Components/Home'
function App() {
  return (
    <Router>
      <Switch>

        <Route exact path="/" >
          <Home />
        </Route>
        <Route path="/create"></Route>

      </Switch>

    </Router>
  );
}

export default App;
